import './Women.css'
import { useQuery, gql } from "@apollo/client";

const query = gql`
  {
    Products(limit: 6) {
      id
      category
    }
  }
`;

function Women() {
  const { product, loading, error } = useQuery(query);

  if (loading) return (
      <p> Loading </p>
      );
  if (error) return (
    <pre>{error.message}</pre>
  )

  return (
    <div className="Women">
      <h1>Category Name</h1>
        <div className='boxes'>
              <div className="box">
                {product.Products.map()}
